import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const step1 = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: step1 });
    screenshots.push(step1);

    // Wait for the search input using its placeholder attribute (different selector)
    await page.waitForSelector('input[placeholder="Search Amazon"]', { timeout: 5000 });

    // Type 'iPhone' into the search input
    await page.fill('input[placeholder="Search Amazon"]', 'iPhone');

    // Take screenshot after typing
    const step2 = path.join(screenshotsDir, 'step_2_typed_iphone.png');
    await page.screenshot({ path: step2 });
    screenshots.push(step2);

    // Wait for the search button using nth-of-type strategy (since there are multiple .search-btn)
    // We'll click the first visible .search-btn after the input
    const searchBtn = await page.$('input[placeholder="Search Amazon"] + .search-btn');
    if (searchBtn) {
      await searchBtn.click();
    } else {
      // fallback: click the first visible .search-btn on the page
      const allBtns = await page.$$('.search-btn');
      if (allBtns.length > 0) {
        await allBtns[0].click();
      }
    }

    // Wait for the main content area to update (look for heading with "Search Results" or similar)
    // Try to wait for a heading containing 'Search Results' (case-insensitive)
    await page.waitForSelector('h2:has-text("Search Results")', { timeout: 5000 });

    // Take screenshot of the search results
    const step3 = path.join(screenshotsDir, 'step_3_search_results.png');
    await page.screenshot({ path: step3 });
    screenshots.push(step3);

    // Extract product titles containing 'iPhone' from the results
    // We'll look for product cards with h3.product-title containing 'iPhone'
    const productTitles = await page.$$eval('h3.product-title', nodes =>
      nodes
        .filter(node => /iphone/i.test(node.textContent))
        .map(node => node.textContent.trim())
    );

    // Also extract the number of results shown in the results-count element, if present
    let resultsCount = null;
    try {
      resultsCount = await page.$eval('.results-count', el => el.textContent.trim());
    } catch {}

    return {
      success: true,
      action: "Searched for 'iPhone' and extracted product titles from search results",
      extractedData: {
        productTitles,
        resultsCount
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
